# import math
def getPattern(num, i):
	pattern=[0,1,0,-1]
	n=((i//num)%4)
	return pattern[n]

def getOnes(num):
	return abs(num)%10

def phase(arr):
	output=""
	for i in range(len(arr)):
		total=0
		for j in range(len(arr)):
			p=getPattern(i+1, j+1)
			# print(arr[j] , "*", p)
			total+=(arr[j]*p)
		output+=str(getOnes(total))
	return output





